        "description": "<div style='margin: 0px; padding: 0px; color: rgb(77, 77, 77); font-family: '><span style='line-height: 18px;'><font size='2'>This map shows the 2012 Purchasing Power per Capita for Colombia, by multiple levels of geography.  Purchasing Power describes the disposable income (income without taxes and social security contributions, including received transfer payments) of a certain area's population. The Purchasing Power per Capita figures are in Colombian pesos per capita.</font></span></div><div style='margin: 0px; padding: 0px; color: rgb(77, 77, 77); font-family: '><span style='line-height: 18px;'><font size='2'><br /></font></span></div><div style='margin: 0px; padding: 0px; color: rgb(77, 77, 77); font-family: '><font size='2'><span style='line-height: 1.38461538461538;'>The source of this information is </span><a href='http://www.mb-research.de/' style='color: rgb(33, 117, 155); line-height: 1.38461538461538; outline: none !important;' target='_blank'>Michael Bauer Research</a><span style='line-height: 1.38461538461538;'>.</span></font></div>",
